import React from 'react'
import './SearchBox.css'
const SearchBox = (props) => {
    return (
        <>
        <div className='searchBox'>
            <h1>Movies</h1>
            <input 
                type="text" value={props.value} 
                onChange={(event) => props.setSearchVal(event.target.value)}
                placeholder='Search'
            />
        </div>
        </>
    );
}

export default SearchBox;
